import React, { useState } from "react";
import TableList from "./TableList";
import { loadContributors } from "./../logic/contributorsActions";

function Dashboard() {
  const [contributorsList, setContributorsList] = useState(null);
  const [error, setError] = useState(null);

  console.log("there is the contributors in DASHBOARD", contributorsList);

  const [repoName, setRepoName] = useState("");

  function handleSubmit(event) {
    event.preventDefault();
    setContributorsList([]);
    loadContributors(repoName).then(setContributorsList).catch(setError);
  }

  return (
    <>
      <h1>Contributors List</h1>
      <form>
        <input
          placeholder="Repository name"
          onChange={(event) => setRepoName(event.target.value.trim())}
        ></input>
        <button
          type="submit"
          onClick={(event) => {
            handleSubmit(event);
          }}
        >
          View contributors!
        </button>
      </form>
      {/*       <SearchForm error={error} contributorsList={contributorsList} />
       */}
      <TableList contributorsList={contributorsList} error={error} />
    </>
  );
}

export default Dashboard;
